import React, { useEffect, useState } from "react";
import { api } from "../../utils/api";

const Table = () => {
  const [users, setUsers] = useState();

  const getUsers = () => {
    api.getUsers().then((res) => console.log(res));
  };

  useEffect(() => {
    getUsers();
  }, []);
  return <div>Table</div>;
};

export default Table;
